【ソフティモ クレンジングフォーム ハニーホイップ つめかえの詳細】<br>●１品でメイク落とし＋洗顔ができる、贅沢はちみつ泡のクレンジングフォーム。<br>●高密着はちみつ泡でキメに入り込んだメイクまで１度にすっきり。<br>●つっぱり感ゼロのトゥルンとしたなめらかな美肌に。<br>●やさしい使い心地にこだわった５フリー処方。<br>●天然香料使用。ほのかに香るフローラルハニーの香り。<br><br>【使用方法】<br>手のひらに適量(ポンプ3～5回押し程度)を取り、顔全体を包み込むようにやさしく洗顔し、そのあと充分にすすいでください。<br><br>【ご注意】<br>○容器は振らずに置いたままお使いください。<br>○直接水がかかる状態でポンプを押さないでください。<br>○目に入ったときは、すぐに洗い流してください。<br>○高温または低温のところ、日のあたるところには置かないでください。<br>○製品の特性上、まれに沈殿物が出ることがありますが、品質には問題ありません。<br><br>【成分】<br>水、DPG、ココイルグリシンK、ヤシ脂肪酸K、マルチトール、ラウリルベタイン、コカミドプロピルベタイン、セリン、ハチミツ、EDTA-2Na、EDTA-3Na、PCA、クエン酸、グリセリン、トリイソステアリン酸PEG-20グリセリル、ポリクオタニウム-7、ラウリン酸ポリグリセリル-10、塩化Na、炭酸水素Na、フェノキシエタノール、安息香酸Na、香料<br><br>【内容量】<br>170ml<br><br><br>【原産国】<br>日本<br><br>【販売元・製造元・輸入者名】<br>コーセーコスメポート株式会社<br>東京都中央区日本橋1丁目16-11 日本橋Dスクエア<br>お客様相談室：03-3277-8551<br><br>【商品区分】<br>化粧品<br><br>［softymo Honey ソフティモ ハニーホイップ クレンジング］<br><br><br><hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
