●植物生まれの泡立つクレンジング成分配合<br>すっきり・みずみずしい洗いあたりを実現。ふんわり泡が、落ちにくいメイクや毛穴の奥の汚れまで、1度でしっかり落とします。<br>●美容液成分ヤトムギエキス＆うるおいベール成分（保湿）配合<br>くすみの原因となる残存メラニンも含んだ古い角質もすっきり落とし、輝くような明るい素肌にみちびきます。<br>●素肌のときの洗顔料としてもお使いいただけます。<br>●無香料・無着色。Ｗ洗顔不要<br><br>【ご使用法】<br>●ポンプを押すと泡になって出てきます。<br>●手のひらに適量(ポンプ3回押し程度)をとり、やさしく洗顔し、そのあと充分にすすいでください。<br>●「ソフティモ ホワイト 泡クレンジングウォッシュ」専用の容器です。他の製品をつめかえても泡にならない場合があります。<br><br>【ご使用上の注意】<br>○ポンプ部分に直接水がかかる状態でお使いにならないでください。<br>○目に入ったときは、すぐに洗い流してください。<br>○高温の場所には、保管しないでください。<br>○製品の特製上、低温下で白くにごる場合がありますが、品質には問題ありません。<br>○つめかえる際は、必ず中身を使い切ってください。<br>○傷やはれもの・湿疹等、お肌に異常のあるときはお使いにならないでください。<br>○使用中、赤味・はれ・かゆみ・刺激等の異常があらわれた場合は、使用を中止し、皮膚科専門医等へご相談ください。そのまま使用を続けますと症状が悪化することがあります。<br>○乳幼児の手の届かないところに保管してください。<br><br>【配合成分】<br>水、DPG、コカミドDEA、(ラウリン酸/ミリスチン酸)TEA、ヤシ脂肪酸K、ラウリルベタイン、ココアンホ酢酸Na、ハトムギエキス、ベタイン、BG、EDTA-2Na、EDTA-3Na、エタノール、エチルへキサン酸セチル、クエン酸、コカミドプロピルベタイン、ココイルグリシンK、ココイルグルタミン酸TEA、スルホコハク酸ラウレス2Na、塩化Na、フェノキシエタノール<br><br>【内容量】<br>200ｍｌ<br><br><br>【原産国】<br>日本<br><br>【販売元・製造元・輸入者名】<br>コーセーコスメポート株式会社<br>東京都中央区日本橋1丁目16-11 日本橋Dスクエア<br>お客様相談室：03-3277-8551<br><br>【商品区分】<br>化粧品<br><br>［コーセーコスメポート ソフティモ］<br><br><br><hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
